Adobe Digital Imaging How-Tos: 100 Essential Techniques for Photoshop CS5, Lightroom 3, and Camera Raw.

Adobe Digital Imaging How-Tos: Essential Techniques for Photoshop CS5, Lightroom 3, and Camera Raw 6 is a concise, current, and affordable full-colour guide to the key techniques for working with digital images. Choose the How-Tos guide when you want to learn the features and functions that provide immediate results. This book covers core features without getting bogged down in obscure details; it provides a single reference for effective Lightroom-to-Photoshop and ACR-to-Photoshop workflows.

